<H1><A NAME="c4763"></A><SUP></SUP>Compiler Warning (level 2) C4763</H1>

<P class=dt><B>'function' : function too large for postoptimizer</B></P>

<P>Not enough space was available to optimize the given function.</P>

<P>One of the following may be a solution:

<UL type=disc>
